import {VFC} from 'react';
import {BiMenu} from 'react-icons/bi';
import {FaFacebookF, FaInstagram, FaTwitter} from 'react-icons/fa';

export const WebsiteOverlay: VFC = () => {
    return <div className="absolute w-full h-full z-10 p-10 text-white">
        <div className="flex">
            <div className="text-lg font-bold uppercase">Bilidly</div>
            <div className="ml-auto text-4xl font-bold uppercase"><BiMenu/></div>
        </div>
        <div className="flex font-bold flex-col my-auto max-w-[38rem] backdrop-blur-[40px] p-4 rounded-3xl">
            <div className="uppercase text-8xl">LOADING...</div>
            <div className="uppercase text-5xl mb-6">APES VS. PROTOCOL</div>
            <div className="mb-6">Bilidly is a roll-out of Solidly protocol on Binance Smart Chain
            </div>
            <button className="mr-auto px-6 py-2 bg-white text-lg text-black uppercase rounded-lg font-bold">Explore</button>
        </div>
        <div className="flex text-3xl gap-8 mt-auto">
            <FaFacebookF/>
            <FaTwitter/>
            <FaInstagram/>
        </div>
    </div>;
};
